import { Link } from "react-router-dom";

function Sidebar() {
    return (<>
        <ul class="list-group">
            <Link to="/home"></Link><li class="list-group-item">Home</li>
            <Link to="/library"></Link><li class="list-group-item">Librar</li>
        </ul>
    </>)
}
export default Sidebar;
